import { Button } from '@material-ui/core';
import React from 'react';
import { Link } from 'react-router-dom';
import AppBarPokemon from './AppBar';

const Main = () => {
    return (
        <div>
            <AppBarPokemon>
                <Button>
                    <Link to="/">Home</Link>
                </Button>
                <Button>
                    <Link to="/pokemons">Pokedex</Link>
                </Button>
            </AppBarPokemon>
        </div>
    );
};

export default Main;
